import {Link} from 'rea'

const Card=({id,name,status,species,gender,origin,image,onClose})=> {
   return (
      <div>
         <button onClick={()=>onClose(id)}>X</button>
         <img src={image} alt='' /> 
         <h2>{id}</h2>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin}</h2>
      </div>
   );
}

export default Card;
